import React from 'react';
import { createDrawerNavigator } from '@react-navigation/drawer';
import { createStackNavigator } from '@react-navigation/stack';
import { View, Text, StyleSheet } from 'react-native';

// Define local fallback components instead of importing from problematic path
const DashboardScreen = () => (
  <View style={styles.container}>
    <Text style={styles.title}>Dashboard</Text>
    <Text style={styles.subtitle}>Welcome to your admin panel</Text>
  </View>
);

const ContentManagementScreen = () => (
  <View style={styles.container}>
    <Text style={styles.title}>Content Management</Text>
  </View>
);

const SeriesScreen = () => (
  <View style={styles.container}>
    <Text style={styles.title}>Series</Text>
  </View>
);

const SeasonsScreen = () => (
  <View style={styles.container}>
    <Text style={styles.title}>Seasons</Text>
  </View>
);

const EpisodesScreen = () => (
  <View style={styles.container}>
    <Text style={styles.title}>Episodes</Text>
  </View>
);

const UsersScreen = () => (
  <View style={styles.container}>
    <Text style={styles.title}>Users</Text>
  </View>
);

const AnalyticsScreen = () => (
  <View style={styles.container}>
    <Text style={styles.title}>Analytics</Text>
  </View>
);

const Drawer = createDrawerNavigator();
const Stack = createStackNavigator();

const ContentStackNavigator = () => (
  <Stack.Navigator screenOptions={{ headerShown: false }}>
    <Stack.Screen name="ContentManagementHome" component={ContentManagementScreen} />
    <Stack.Screen name="SeriesList" component={SeriesScreen} />
    <Stack.Screen name="SeasonsList" component={SeasonsScreen} />
    <Stack.Screen name="EpisodesList" component={EpisodesScreen} />
  </Stack.Navigator>
);

const AdminNavigator = () => (
  <Drawer.Navigator initialRouteName="AdminDashboard" screenOptions={{ headerShown: true }}>
    <Drawer.Screen name="AdminDashboard" component={DashboardScreen} options={{ title: 'Dashboard' }}/>
    <Drawer.Screen name="ContentManagement" component={ContentStackNavigator} options={{ title: 'Content' }} />
    <Drawer.Screen name="Users" component={UsersScreen} options={{ title: 'Users' }} />
    <Drawer.Screen name="Analytics" component={AnalyticsScreen} options={{ title: 'Analytics' }} />
  </Drawer.Navigator>
);

const styles = StyleSheet.create({
  container: {
    flex: 1,
    padding: 20,
    backgroundColor: '#1e1e1e',
    alignItems: 'center',
    justifyContent: 'center',
  },
  title: {
    fontSize: 24,
    fontWeight: 'bold',
    color: '#ffffff',
    marginBottom: 20,
  },
  subtitle: {
    fontSize: 16,
    color: '#bbbbbb',
    textAlign: 'center',
  }
});

export default AdminNavigator;
